import "../styles/Navbar.css";

function Navbar() {
  return (
    <div className="navbar">
      <div className="leftSide">
        <h1>What happened</h1>
      </div>
      <div className="rightSide">
        <a>INTRODUCTION</a>
        <a>SOLUTION</a>
        <a>RATE PLAN</a>
        <a>LOGIN</a>
        <a>APPLY FOR TEST</a>
      </div>
    </div>
  );
}

export default Navbar;
